import { NavLink, Outlet } from "react-router-dom";

const RootLayout = () => {
    return (
        <>
            <nav className="bg-gray-100 rounded-md px-3 flex justify-between divide-yellow-500">
                <div className="text-center p flex-1 ml-1 bg-yellow-50">
                    <NavLink to="/" className="">الشراء</NavLink>
                </div>
                <div className="text-center p flex-1 bg-yellow-50">
                    <NavLink to="sales" className="" >المبيعات</NavLink>
                </div>
            </nav>
            <main>
                <Outlet />
            </main>
        </>
    );
}

export default RootLayout;
